def getKeyList(keylist_str):
    keylist = keylist_str.split("; ")
    print("keylist length: {}".format(len(keylist)))
    return keylist

def getKeySet(keylist_list):
    keyset = set()
    for i in range(len(keylist_list)):
        for key in keylist_list[i]:
            keyset.add(key)
    print("keyset length: {}".format(len(keyset)))
    return keyset

# Get diffset = keyset0 - keyset1
def getDiffSet(keyset0, keyset1):
    diffset = set()
    for key in keyset0:
        if key not in keyset1:
            diffset.add(key)
    print("diffset length: {}".format(len(diffset)))
    return diffset

